import SHOP_DATA from '../../services/shopData';
import { UPDATE_COLLECTIONS } from '../actions/shop';

const INITIAL_STATE = {
    collections: SHOP_DATA
};

const shopReducer = (state = INITIAL_STATE, action) => {
    switch(action.type) {
        default:
            return state;
    }
};

export default shopReducer;
